import React from 'react';
import style from './App.module.css';

const App = () => {
  return (<>
    <main>
      <div className="container-fluid">
        <div className="row">
          <div className="col-lg-4 col-md-3 d-md-block d-none"></div>
          <div className="col-lg-8 col-md-9"></div>
        </div>
      </div>
    </main>
  </>);
}

export default App;
